import React, { Component } from 'react';
import {getMovies} from '../service./moviesservice.js'
class Movies extends Component {
    state = { 
        movie:getMovies()
     } 
    render() { 
        return (
            <div>
                <table class="table">
                    <thead>
                    <tr>
                        <th scope="col">movie's name</th>
                        <th scope="col">id</th>
                        <th scope="col">ganre</th>
                        <th scope="col">length</th>
                        <th scope="col">delete</th>
                    </tr>
                    </thead>
                    <tbody>
                    {this.state.movie.map(movie=>(
                    <tr>
                        <td>{movie.name}</td>
                        <td>{movie.id}</td>
                        <td>{movie.genre}</td>
                        <td>{movie.length}</td>
                    </tr>
                    ))}</tbody>
                </table>
            </div>
        );
    }
}

export default Movies;
